  NACHT varchar(5) default NULL,
  SAMSTAG varchar(5) default NULL,
  FUERZEIT tinyint(3) unsigned NOT NULL default '0',
  DAUER tinyint(3) unsigned NOT NULL default '0',
  ZWILLINGE varchar(5) default NULL,
  ZWEITESMAL varchar(5) default NULL,
  EINMALIG varchar(5) default NULL,
  BEGRUENDUNGSPFLICHT enum('j','n') default NULL,
